using tup = tuple<int, int, int>;

constexpr int kMax = 1e6;

int main() {
  ios::sync_with_stdio(false);
  cin.tie(nullptr);

  char* table = (char*)malloc(248852 + 1);
  table[248852] = '\0';

  DecodeBase64(kTable, sizeof(kTable) - 1, table);
  auto out = zlib::dz(table, 248852, true);
  uint16_t* memo = (uint16_t*)out.data();

  vector<tup> dist(kMax + 1, {INT_MAX, 0, 0});
  for (int i = 1; i <= kMax; i++) {
    for (int j = 1; j <= i && j * i <= kMax; j++) {
      int x = i * j, y = i + j;
      if (get<0>(dist[x]) > y) dist[x] = {y, i, j};
    }
  }

  vector<pair<int, int>> arr, adj;

  int t;
  cin >> t;
  while (t--) {
    int k;
    cin >> k;

    arr.clear();
    adj.clear();

    int rem = k;
    while (rem) {
      for (int i = rem; i >= 1; i--) {
        int nxt = rem - i;
        if (memo[nxt] + get<0>(dist[i]) - 1 == memo[rem]) {
          auto [xy, x, y] = dist[i];
          arr.push_back({x, y});
          rem = nxt;
          break;
        }
      }
    }
    sort(arr.begin(), arr.end());

    int na = arr.size(), nf, nt, idx = 1;
    if (na == 1) {
      auto [x, y] = arr[0];
      while (x--) adj.push_back({1, ++idx});
      nf = idx;
      while (y--) adj.push_back({1, ++idx});
      nt = idx - nf;
    } else {
      swap(arr[1], arr.back());

      for (int i = 1; i < na; i++) {
        adj.push_back({i, i + 1});
      }

      idx = na;
      for (int i = 1; i <= na; i++) {
        auto [x, y] = arr[i - 1];
        x -= (i == 1 || i == na ? 1 : 2);
        while (x--) adj.push_back({i, ++idx});
      }
      nf = idx;
      for (int i = 1; i <= na; i++) {
        auto [x, y] = arr[i - 1];
        while (y--) adj.push_back({i, ++idx});
      }
      nt = idx - nf;
    }

    string ans;
    ans.reserve(idx);
    ans.append(nf, 'F');
    ans.append(nt, 'T');

    cout << idx << "\n"
         << ans << "\n";
    for (auto [u, v] : adj) cout << u << " " << v << "\n";
  }

  return 0;
}